class MenuItem extends Component{

    clickevent = () => {
        alert('asd');
    }

    render(){
        return (
            <div>
                <button onClick={() => {alert('hh')}} >Click me!</button>
                {/* // <button onClick={() => alert('Click!')}>Click Me!</button> */}
            </div>
        )
    }
}

export default MenuItem;
